import math

def poly(xs: list, x: float) -> float:
    """Evaluate polynomial with coefficients xs at point x."""
    return sum([coeff * math.pow(x, i) for i, coeff in enumerate(xs)])

def poly_derivative(xs: list, x: float) -> float:
    """Compute the derivative of the polynomial at point x."""
    n = len(xs)
    return sum([i * xs[i] * math.pow(x, i - 1) for i in range(1, n)])

