import math

MOD = 998244353

def inv(n, mod=MOD):
    """Return the modular inverse of n modulo mod using Extended Euclidean Algorithm."""
    if n < 0:
        n += mod
    if n == 0:
        return 0
    if n == 1:
        return 1
    return pow(n, mod - 2, mod)

def comb(n, k, mod=MOD):
    """Return n choose k modulo mod."""
    if k < 0 or k > n:
        return 0
    k = min(k, n - k)
    num = den = 1
    for i in range(k):
        num = num * (n - i) % mod
        den = den * (i + 1) % mod
    return num * inv(den, mod) % mod

"""
Return the number of triples (i,j,k) with i<j<k such that a[i]+a[j]+a[k] ≡ 0 mod 3.
a[i] = i*i - i + 1 = i*(i-1)+1 ≡ i mod 3.
Thus, we need i+j+k ≡ 0 mod 3.
Count triples using residue classes modulo 3.
"""
if n < 3:
    return 0

# Count residues modulo 3 for indices 1 to n
count = [0, 0, 0]
for i in range(1, n+1):
    count[i % 3] += 1

total = 0
# Iterate over all possible counts (x,y,z) with x+y+z = n and x+y+z ≡ 0 mod 3
for x in range(count[0] + 1):
    for y in range(count[1] - x + 1):
        z = count[2] - y
        if x + y + z == n and (x + y + z) % 3 == 0:
            # Count triples: C(x,1)*C(y,1)*C(z,1) = x*y*z
            total += (x * y * z) % MOD

return total

