count = [0, 0, 0]  # count residues 0, 1, 2 modulo 3
for i in range(1, n + 1):
    residue = (i * i - i + 1) % 3
    count[residue] += 1

c0, c1, c2 = count
if c2 > 0:
    return 0  # no element with residue 2, so no valid triples

# Count triples with all residues 1
if c1 >= 3:
    triple1 = c1 * (c1 - 1) * (c1 - 2) // 6
else:
    triple1 = 0

# Count triples with one residue 0 and two residues 1
if c0 * c1 >= 2:
    triple2 = c0 * c1 * (c1 - 1) // 2
else:
    triple2 = 0

# Count triples with three residues 0
if c0 >= 3:
    triple3 = c0 * (c0 - 1) * (c0 - 2) // 6
else:
    triple3 = 0

return triple1 + triple2 + triple3

